import React, { useRef, useEffect } from 'react';
import * as maptilersdk from '@maptiler/sdk';
import "@maptiler/sdk/dist/maptiler-sdk.css";
// import './map.css';

const Map: React.FC = () => {
    const mapContainer = useRef<HTMLDivElement | null>(null);
    const map = useRef<maptilersdk.Map | null>(null);
    const sarajevo = { lng: 18.4051, lat: 43.8763 };
    const zoom = 11;
    const minZoom = 9;

    maptilersdk.config.apiKey = 'JBbuRTLapsGD0oyQPYsL';

    useEffect(() => {
    if (map.current) return; // stops map from initializing more than once

    if (mapContainer.current) {
        map.current = new maptilersdk.Map({
            container: mapContainer.current,
            style: maptilersdk.MapStyle.TOPO,
            center: [sarajevo.lng, sarajevo.lat],
            zoom: zoom,
            minZoom: minZoom
    });

    const customIcon = `<svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 500 500" width="600" height="600">
	<defs>
		<image  width="300" height="400" id="img1" href="data:image/png;base64,"/>
	</defs>
	<style>
	</style>
	<use id="Background" href="#img1" x="113" y="84"/>
</svg>`;

  new maptilersdk.Marker({ 
    element: createCustomMarkerElement(customIcon) 
  })
  .setLngLat([sarajevo.lng, sarajevo.lat])
  .addTo(map.current);
}
}, [sarajevo.lng, sarajevo.lat, zoom]);

function createCustomMarkerElement(svg: string): HTMLDivElement {
    const div = document.createElement('div');
    div.innerHTML = svg;
    div.style.width = '120px'; // Customize width
    div.style.height = '120px'; // Customize height
    div.style.display = 'flex';
    div.style.alignItems = 'center';
    div.style.justifyContent = 'center';
    return div;
  }
  
return (
    <div className="map-wrap relative w-full h-80 md:h-full pt-5">
        <div 
        ref={mapContainer}
        className="map absolute w-full h-full rounded-3xl" 
        />
        <style jsx>{`
            .maplibregl-ctrl-top-right button {
                background-color: #f0f0f0; /* Customize button background */
                border: none;
                border-radius: 6px; /* Customize button border-radius */
                padding: 8px;
            }
            .maplibregl-ctrl-top-right button:hover {
                background-color: #ccc; /* Hover state for buttons */
            }
            .maplibregl-ctrl-top-right button svg {
                fill: #333; /* Customize SVG icon color */
            }
        `}</style>
    </div>
);
};

export default Map;
